// HomeNavbar.jsx
import "../styles/HomeNavbar.css"
import React from "react";
import { Link, useLocation, useNavigate } from "react-router-dom";
import logo from "../assets/quizapp_logo.png";
import icon from "../assets/person-icon-1.png";

const HomeNavbar = () => {
    const location = useLocation();
    const navigate = useNavigate();

    const isLoginPage = location.pathname === "/login";
    const isSignupPage = location.pathname === "/signup";
    const isLoggedIn = localStorage.getItem("isLogin") === "true";

    const handleLogout = () => {
        localStorage.removeItem("isLogin");
        navigate("/"); // Redirect to homepage or login
    };

    return (
        <nav className="navbar bg-dark">
            <div className="logo">
                <Link to="/">
                    <img src={logo} alt="quiz-app-logo" />
                </Link>
            </div>
            <div className="nav-right">
                <ul className="nav-links">
                    {!isLoggedIn && !isLoginPage && (
                        <li>
                            <Link to="/login" className="bordered-link">Login</Link>
                        </li>
                    )}
                    {!isLoggedIn && !isSignupPage && (
                        <li>
                            <Link to="/signup" className="bordered-link">Sign Up</Link>
                        </li>
                    )}
                    {isLoggedIn && (
                        <>
                            <li>
                                <Link to="/profile" className="bordered-link">Profile</Link>
                            </li>
                            <li>
                                <button
                                    onClick={handleLogout}
                                    className="bordered-link logout-button"
                                    style={{ background: 'none', border: 'none', color: 'white', cursor: 'pointer' }}
                                >
                                    Logout
                                </button>
                            </li>
                        </>
                    )}
                </ul>
                <div className="icon">
                    <Link to={isLoggedIn ? "/profile" : "/"}>
                        <img src={icon} alt="user-icon" />
                    </Link>
                </div>
            </div>
        </nav>
    );
};

export default HomeNavbar;
